import './header.css';

const Header = () => {
    return (
        <div className="header">
            <div className="headerTitles">
                <span className="headerTitleSm">React & Node</span>
                <span className="headerTitleLg">Blog</span>
            </div>
            <img className="headerImg" src="https://s2.qwant.com/thumbr/0x380/c/6/bf26bc3b1f4faeb42e814d4e3f3405cdfac22d2e69721d9b51f6200ede7047/ocean-1-732956.jpg?u=http%3A%2F%2F3.bp.blogspot.com%2F-brcKJhGn3hE%2FTscJERsUAnI%2FAAAAAAAAAeM%2FzCy4Ye95wrw%2Fs1600%2Focean-1-732956.jpg&q=0&b=1&p=0&a=0" alt=""></img>
        </div>
    );
}

export default Header;
